import axios from 'axios';

const API_URL = 'http://localhost:3001/api/users';

const getUsers = () => {
    return axios.get(API_URL);
};

const createUser = (userData) => {
    return axios.post(API_URL, userData);
};



export default {
    getUsers,
    createUser,

};
